             <ul>
               <li><a href="product1.html#Shop_Skateboards/Snowboards"><img src="https://static.highsnobiety.com/thumbor/85xfd0GhUNBoClNge3ZZYjrzbWk=/fit-in/800x1001/smart/static.highsnobiety.com/wp-content/uploads/2018/04/30111809/supreme-skateboard-decks-9.jpg" alt="skateboard"></img><h4>Skateboard</h4></a></li>
